"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pericarditis in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pericarditis-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H6662567\">",
"      <span class=\"h1\">",
"       What is pericarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pericarditis is a condition that causes irritation of the tissue around your heart. This tissue (called the pericardium) forms a sac that protects your heart and keeps it from rubbing against nearby organs (",
"      <a class=\"graphic graphic_figure graphicRef69323 \" href=\"mobipreview.htm?0/27/432\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662584\">",
"      <span class=\"h1\">",
"       What are the symptoms of pericarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms of pericarditis can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Chest pain is the most common pericarditis symptom. It can be a sharp pain or a dull ache. You might feel pain in the front of your chest, your shoulder, or your upper back.",
"     </p>",
"     <p>",
"      If you have sharp chest pain, it might get worse when you take a deep breath. If the pain is a dull ache, it might get better when you sit up and lean forward.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662599\">",
"      <span class=\"h1\">",
"       Is there a test for pericarditis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor will ask you about your symptoms and do one or more of these tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An electrocardiogram (ECG or EKG)&nbsp;&mdash; This test measures the electrical activity in your heart.",
"       </li>",
"       <li>",
"        An echocardiogram&nbsp;&ndash; This test uses sound waves to create an image of your heart as it beats.",
"       </li>",
"       <li>",
"        Chest X-ray &ndash; An X-ray can show if there is a large amount of fluid around your heart. &nbsp;",
"       </li>",
"       <li>",
"        Blood tests&nbsp;&mdash; These measure the levels of certain proteins in your blood, which hold clues about the health of your heart. Certain proteins go up in response to pericarditis. Doctors can measure the levels of these proteins to check for pericarditis and to see if it is improving.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662614\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See your doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You have chest pain",
"       </li>",
"       <li>",
"        You feel short of breath, weak, or faint",
"       </li>",
"       <li>",
"        You have swelling in your legs or other parts of the body",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you think you might be having a heart attack,",
"      <strong>",
"       call 9-1-1 right away",
"      </strong>",
"      . Do not try to get to the hospital on your own.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662629\">",
"      <span class=\"h1\">",
"       How is pericarditis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main treatments for pericarditis are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines to reduce pain and inflammation, such as",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?6/12/6342?source=see_link\">",
"         aspirin",
"        </a>",
"        ,",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil",
"        <sup>",
"         &reg;",
"        </sup>",
"        , Motrin",
"        <sup>",
"         &reg;",
"        </sup>",
"        ), or",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?0/34/550?source=see_link\">",
"         indomethacin",
"        </a>",
"        (brand name: Indocin",
"        <sup>",
"         &reg;",
"        </sup>",
"        )",
"       </li>",
"       <li>",
"        A medicine called",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?39/40/40580?source=see_link\">",
"         colchicine",
"        </a>",
"        (brand name: Colcrys",
"        <sup>",
"         &reg;",
"        </sup>",
"        ) &nbsp;",
"       </li>",
"       <li>",
"        Rest",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you need more treatment, your doctor can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Give you steroids and other medicines to reduce inflammation (not the same steroids athletes take to build up muscle)",
"       </li>",
"       <li>",
"        Do surgery to remove swollen, irritated tissue from around the heart &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6662644\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
