"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Nonalcoholic steatohepatitis (NASH) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/nonalcoholic-steatohepatitis-nash-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H21262048\">",
"      <span class=\"h1\">",
"       What is nonalcoholic steatohepatitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Nonalcoholic steatohepatitis (NASH) is a long-term condition that affects the liver. The liver is a big organ in the upper right side of the belly (",
"      <a class=\"graphic graphic_figure graphicRef64960 \" href=\"mobipreview.htm?39/54/40804\">",
"       figure 1",
"      </a>",
"      ). When people have NASH, fat tissue builds up in their liver, and the liver gets inflamed.",
"     </p>",
"     <p>",
"      People who drink too much alcohol can get a condition similar to NASH. But NASH happens in people who do not drink alcohol or drink only a little alcohol.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262055\">",
"      <span class=\"h1\">",
"       What causes NASH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors do not know what causes NASH. They do know that NASH happens more often in some people, such as those who:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Are overweight",
"       </li>",
"       <li>",
"        Have a condition called diabetes mellitus, which causes blood sugar levels to get too high",
"       </li>",
"       <li>",
"        Have high cholesterol",
"       </li>",
"       <li>",
"        Take certain medicines",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262062\">",
"      <span class=\"h1\">",
"       What are the symptoms of NASH?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with NASH have no symptoms.",
"     </p>",
"     <p>",
"      Your doctor or nurse might suspect that you have NASH from the results of your routine blood tests.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262069\">",
"      <span class=\"h1\">",
"       Will I need more tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your doctor or nurse suspects that you have NASH, you will likely have:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        More blood tests",
"       </li>",
"       <li>",
"        An imaging test of the liver, such as an ultrasound, CT, or MRI scan &mdash; Imaging tests create pictures of the inside of the body.",
"       </li>",
"       <li>",
"        A liver biopsy &mdash; During this test, a doctor removes a small sample of tissue from the liver. Then another doctor looks at the sample under a microscope to see if NASH is present. A liver biopsy is the only test that can tell for sure if you have NASH.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262076\">",
"      <span class=\"h1\">",
"       How is NASH treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There is no cure for NASH. If you take a medicine that could be causing NASH, your doctor will stop or change that medicine.",
"     </p>",
"     <p>",
"      In addition, your doctor will treat your other medical conditions. For example, he or she can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Help you create a weight loss plan, if you are overweight &mdash; If your doctor recommends that you lose weight, it&rsquo;s important to do this slowly. Do not lose more than 3.5 pounds (1.6 kilograms) a week.",
"       </li>",
"       <li>",
"        Treat your high blood sugar, if you have high blood sugar",
"       </li>",
"       <li>",
"        Treat your high cholesterol, if you have high cholesterol",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262083\">",
"      <span class=\"h1\">",
"       Does NASH get worse over time?",
"      </span>",
"      &nbsp;&mdash;&nbsp;NASH does not usually get worse over time. But sometimes, it leads to serious scarring of the liver, called &ldquo;cirrhosis.&rdquo; Cirrhosis can cause different symptoms, such as swelling in the legs, trouble breathing, or feeling tired. If you get cirrhosis, your doctor will talk with you about different possible treatments.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H21262090\">",
"      <span class=\"h1\">",
"       Do I need to follow up with my doctor?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. People who have NASH need to see their doctor for regular check-ups. Your doctor will do follow-up tests on a regular basis. These usually include blood tests.",
"     </p>",
