var title_f37_14_38118="Polyadenylation polymorphism in FSHD";
var content_f37_14_38118=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F50217&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F50217&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 571px\">",
"   <div class=\"ttl\">",
"    Polyadenylation polymorphism in FSHD",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 551px; height: 500px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An intact D4Z4 region in chromosome 4 leaves a condensed chromatin state that prevents transcription of the distal",
"    <em>",
"     DUX4",
"    </em>",
"    gene. Chromosome 10q (and non-FSHD chromosome 4 alleles) does not have functional",
"    <em>",
"     DUX4",
"    </em>",
"    transcription elements. In FSHD, D4Z4 contractions in chromosome 4 (4q) lead to an open chromatin that exposes the distal",
"    <em>",
"     DUX4",
"    </em>",
"    gene and a sequence (pLAM) that encodes a poly(A) signal. This results in the transcription of",
"    <em>",
"     DUX4",
"    </em>",
"    , which may be linked to muscle degeneration in FSHD.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From: Mahadevan MS. Genetics. Exposing a DUX tale. Science 2010; 329:1607. Reprinted with permission from: AAAS. Copyright &copy; 2010.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
