"   </div>",
"   <div class=\"lgnd\">",
"    This photo shows a 35-year-old woman with a symmetrical papulovesicular eruption on the forearms. Lesions were also present on the neck and lower legs.",
"    <div class=\"footnotes\">",
"    </div>",
