"   </div>",
"   <div class=\"lgnd\">",
"    Erythematous papules developed on the dorsal hands, forearms, face, neck, and upper chest of this 40-year-old man with a history of sun exposure. The patient's history and symptoms were consistent with polymorphous light eruption.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Copyright &copy; Shahbaz A Janjua, MD, Dermatlas; file://www.dermatlas.org.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Polymorphous light eruption",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 305px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
